import React, { useState, useEffect, useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../App';
import axios from 'axios';

const Employees = () => {
    const { user } = useContext(AuthContext);
    const [employees, setEmployees] = useState([]);
    const [divisions, setDivisions] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const [showModal, setShowModal] = useState(false);
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        phone: '',
        birth_date: '',
        address: '',
        join_date: '',
        education_level: 'S1',
        major: '',
        last_education_place: '',
        designation: '',
        role: '',
        division_id: ''
    });
    const [submitting, setSubmitting] = useState(false);
    const [searchTerm, setSearchTerm] = useState('');
    const [selectedDivision, setSelectedDivision] = useState('');

    useEffect(() => {
        fetchEmployees();
        fetchDivisions();
    }, []);

    const fetchEmployees = async () => {
        try {
            const response = await axios.get('http://localhost/web_srk_BI/backend/api/employees.php', {
                withCredentials: true
            });
            if (response.data.success) {
                setEmployees(response.data.data);
            } else {
                setError('Gagal memuat data karyawan');
            }
        } catch (error) {
            console.error('Error fetching employees:', error);
            setError('Gagal memuat data karyawan');
        } finally {
            setLoading(false);
        }
    };

    const fetchDivisions = async () => {
        try {
            const response = await axios.get('http://localhost/web_srk_BI/backend/api/divisions.php', {
                withCredentials: true
            });
            if (response.data.success) {
                setDivisions(response.data.data);
            }
        } catch (error) {
            console.error('Error fetching divisions:', error);
        }
    };

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setSubmitting(true);

        try {
            const response = await axios.post('/employees.php', {
                action: 'add',
                ...formData
            });

            if (response.data.success) {
                setShowModal(false);
                setFormData({
                    name: '',
                    email: '',
                    phone: '',
                    birth_date: '',
                    address: '',
                    join_date: '',
                    education_level: 'S1',
                    major: '',
                    last_education_place: '',
                    designation: '',
                    role: '',
                    division_id: ''
                });
                fetchEmployees();
                alert('Karyawan berhasil ditambahkan');
            } else {
                alert(response.data.error || 'Gagal menambahkan karyawan');
            }
        } catch (error) {
            alert('Terjadi kesalahan saat menambahkan karyawan');
            console.error('Add employee error:', error);
        } finally {
            setSubmitting(false);
        }
    };

    const handleDeactivate = async (eid) => {
        if (!window.confirm('Apakah Anda yakin ingin menonaktifkan karyawan ini?')) {
            return;
        }

        try {
            const response = await axios.post('http://localhost/web_srk_BI/backend/api/employees.php', {
                action: 'deactivate',
                eid: eid
            }, { withCredentials: true });

            if (response.data.success) {
                fetchEmployees();
                alert('Karyawan berhasil dinonaktifkan');
            } else {
                alert('Gagal menonaktifkan karyawan');
            }
        } catch (error) {
            console.error('Error deactivating employee:', error);
            alert('Gagal menonaktifkan karyawan');
        }
    };

    const getContractBadge = (contractType) => {
        if (!contractType) return <span className="badge bg-secondary">Tidak ada</span>;
        
        const badges = {
            'probation': <span className="badge bg-warning">Probation</span>,
            '1': <span className="badge bg-primary">Kontrak 1</span>,
            '2': <span className="badge bg-success">Kontrak 2</span>,
            '3': <span className="badge bg-info">Kontrak 3</span>,
            'permanent': <span className="badge bg-dark">Permanent</span>
        };
        
        return badges[contractType] || <span className="badge bg-secondary">{contractType}</span>;
    };

    const getStatusBadge = (status) => {
        const badges = {
            'active': <span className="badge bg-success">Aktif</span>,
            'resigned': <span className="badge bg-danger">Resign</span>,
            'terminated': <span className="badge bg-dark">Terminasi</span>
        };
        
        return badges[status] || <span className="badge bg-secondary">{status}</span>;
    };

    const filteredEmployees = employees.filter(employee => {
        const matchesSearch = employee.full_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                            employee.eid.toLowerCase().includes(searchTerm.toLowerCase()) ||
                            employee.role.toLowerCase().includes(searchTerm.toLowerCase());
        const matchesDivision = selectedDivision === '' || employee.division_id === parseInt(selectedDivision);
        return matchesSearch && matchesDivision;
    });

    if (loading) {
        return (
            <div className="container mt-5">
                <div className="d-flex justify-content-center">
                    <div className="spinner-border" role="status">
                        <span className="visually-hidden">Loading...</span>
                    </div>
                </div>
            </div>
        );
    }

    return (
        <div className="employees-container">
            <div className="employees-header">
                <button className="btn btn-back">
                    <i className="fas fa-arrow-left me-2"></i>
                    Home
                </button>
                <button className="btn btn-danger">
                    Keluar
                </button>
            </div>

            <div className="employees-content">
                <div className="employees-stats">
                    <span>Total Lamaran: {filteredEmployees.length}</span>
                </div>

                {error && (
                    <div className="alert alert-danger">
                        {error}
                    </div>
                )}

                <div className="employees-grid">
                    {filteredEmployees.map(employee => (
                        <div key={employee.eid} className="employee-card">
                            <div className="employee-avatar">
                                <img 
                                    src={employee.profile_picture || '/api/placeholder/80/80'} 
                                    alt="Profile" 
                                    className="avatar-image"
                                />
                            </div>
                            <div className="employee-info">
                                <h5 className="employee-name">{employee.full_name}</h5>
                                <p className="employee-age">{employee.age ? `${employee.age} Tahun` : 'N/A'}</p>
                                <p className="employee-email">{employee.email || 'No Email'}</p>
                            </div>
                            <div className="employee-actions">
                                <Link 
                                    to={`/employees/${employee.eid}`}
                                    className="btn btn-primary btn-sm me-2"
                                >
                                    Details
                                </Link>
                                <button 
                                    className="btn btn-danger btn-sm"
                                    onClick={() => handleDeactivate(employee.eid)}
                                >
                                    Deactive
                                </button>
                            </div>
                        </div>
                    ))}
                </div>

                {filteredEmployees.length === 0 && !loading && (
                    <div className="no-employees">
                        <i className="fas fa-users fa-3x text-muted mb-3"></i>
                        <p className="text-muted">Tidak ada karyawan yang ditemukan</p>
                    </div>
                )}
            </div>

            {/* Footer */}
            <div className="footer-links">
                <a href="#">Tentang Kami</a>
                <a href="#">Kontak</a>
                <a href="#">Kebijakan Privasi</a>
                <a href="#">Ketentuan Layanan</a>
            </div>

            <div className="footer-copyright">
                ©2025 CareerMatch. Semua hak cipta dilindungi.
            </div>
        </div>
    );
};

export default Employees;
